import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { ExamProvider } from "./contexts/ExamContext";
import { UserProvider } from "./contexts/UserContext";
import AppRoutes from './AppRoutes';

const App: React.FC = () => {
  return (
    <UserProvider>
      <ExamProvider>
        <Router>
          <AppRoutes />
        </Router>
      </ExamProvider>
    </UserProvider>
  );
};

export default App;
